import React from 'react';
import './Loader.scss';

export const Loader = () => {
  return (
    <div className="loader">
      <div className="list__box">
        <div className="list__box-img">
        </div>
      </div>
      <div className="list__box2">
        <div className="list__box2-img2">
        </div>
      </div>
      <div className="list__box3">
        <div className="list__box3-img3">
        </div>
      </div>
    </div>
  )
}
